package binding

import (
	"encoding/hex"
	"fmt"

	"github.com/laizy/web3/abi"
)

var abiChallenge *abi.ABI

// ChallengeAbi returns the abi of the Challenge contract
func ChallengeAbi() *abi.ABI {
	return abiChallenge
}

var binChallenge []byte

// ChallengeBin returns the bin of the Challenge contract
func ChallengeBin() []byte {
	return binChallenge
}

var binRuntimeChallenge []byte

// ChallengeBinRuntime returns the runtime bin of the Challenge contract
func ChallengeBinRuntime() []byte {
	return binRuntimeChallenge
}

func init() {
	var err error
	abiChallenge, err = abi.NewABI(abiChallengeStr)
	if err != nil {
		panic(fmt.Errorf("cannot parse Challenge abi: %v", err))
	}
	if len(binChallengeStr) != 0 {
		binChallenge, err = hex.DecodeString(binChallengeStr[2:])
		if err != nil {
			panic(fmt.Errorf("cannot parse Challenge bin: %v", err))
		}
	}
	if len(binRuntimeChallengeStr) != 0 {
		binRuntimeChallenge, err = hex.DecodeString(binRuntimeChallengeStr[2:])
		if err != nil {
			panic(fmt.Errorf("cannot parse Challenge bin runtime: %v", err))
		}
	}
}

